1. The number of ants doubles each hour.
2. The initial number of ants is 50.
3. After 1 hour, there will be 50 * 2 = 100 ants.
4. After 2 hours, there will be 100 * 2 = 200 ants.
5. After 3 hours, there will be 200 * 2 = 400 ants.
6. After 4 hours, there will be 400 * 2 = 800 ants.
7. After 5 hours, there will be 800 * 2 = 1600 ants.
Answer: There will be 1600 ants in the jar after 5 hours.

